style.css:
@-moz-document domain("filelist.io") {
  html {
    background: url("https://e1.pxfuel.com/desktop-wallpaper/1012/490/desktop-wallpaper-the-witcher-3-wild-hunt-main-menu-for-engine-hearts-of-stone.jpg") no-repeat center fixed;
    -webkit-background-size: cover;
    -moz-background-size: cover;
    -o-background-size: cover;
    background-size: cover;
  }

  body {
    background: none;
  }
  #wrapper {
    background: none;
  }
  .mainheader {
    background: none;
  }
  .status_avatar {
    display: none;
  }
  .statusbar {
    background-color: #396e964e;
    box-shadow: 0 0 10px 1px #396e964e;
    border: 0;
    padding: 1rem;
    margin-top: 35px;
    width: fit-content;
  }
  #navigation {
    border: 0;
    background-color: #396e964e;
    box-shadow: 0 0 10px 1px #396e964e;
  }
  #nav ul li a {
    color: #e9e9e9af;
  }
  #nav ul li.active,
  #nav ul li a:hover,
  #nav ul li.active a {
    color: white !important;
    transition: 0.7s;
  }
  font,
  span,
  .statusbar a {
    color: white !important;
    font-weight: 900;
  }
  a {
    color: white !important;
  }
  .pager a,
  .pager a:link {
    background-color: #396e964e !important;
  }
  .pager span.current {
    background-color: #2c418666 !important;
    cursor: pointer !important;
  }
  fieldset {
    background-color: #2c418666 !important;
  }
  #sectionmain .sectiontitle {
    background-color: #2c418666 !important;
  }
  .nblock-headerleft,
  .nblock-header,
  .nblock-headerright,
  .nblock-content,
  .nblock-bottom,
  .sblock-headerleft,
  .sblock-header,
  .sblock-headerright,
  .sblock-content,
  .sblock-bottom,
  .cblock-headerleft,
  .cblock-header,
  .cblock-headerright,
  .cblock-top,
  .cblock-content,
  .cblock-bottom,
  #footer {
    border: 0;
    background: #396e964e !important;
    box-shadow: 0 0 10px 1px #396e964e;
  }
  .cblock-content,
  .sblock-header,
  .nblock-header,
  .nblock-content,
  .cblock-header {
    width: 100% !important;
  }
  .sblock-headerleft,
  .nblock-headerright,
  .sblock-headerright,
  .sblock-bottom,
  .nblock-headerleft,
  .cblock-headerleft,
  .cblock-bottom,
  .cblock-headerright,
  .nblock-bottom {
    width: 0 !important;
  }
  .nblock-bottom {
    width: 684px;
  }
  .colhead {
    color: white !important;
    border: 0;
    background: transparent;
  }
  .cblock-innercontent .colhead {
    border: 1px solid #396e964e;
    background: transparent;
  }
  #copyright {
    border-top: 1px solid #396e964e;
    background: #396e964e;
  }
}
